import{_ as h,c as a,o as e,a4 as t}from"./chunks/framework.CFdyflnk.js";const p=JSON.parse('{"title":"fullhash  chunkhash  contenthash","description":"","frontmatter":{},"headers":[],"relativePath":"build-tools/bundler/webpack/fullhash-chunkhash-contenthash.md","filePath":"build-tools/bundler/webpack/fullhash-chunkhash-contenthash.md","lastUpdated":1727024381000}'),n={name:"build-tools/bundler/webpack/fullhash-chunkhash-contenthash.md"},s=t('<h1 id="fullhash-chunkhash-contenthash" tabindex="-1">fullhash chunkhash contenthash <a class="header-anchor" href="#fullhash-chunkhash-contenthash" aria-label="Permalink to &quot;fullhash  chunkhash  contenthash&quot;">​</a></h1><p>webpack可以配置打包输出的文件名，该文件名可以使用模板字符串，具体参考<a href="https://webpack.js.org/configuration/output/#template-strings" target="_blank" rel="nofollow noopener noreferrer">webpack文档</a>。<code>[fullhash]</code>, <code>chunkhash</code>, <code>contenthash</code> 是其中三个。主要区别为：</p><ul><li>fullhash 是针对整个编译范围（项目）计算的hash，每个文件的hash和项目的hash相同</li><li>chunkhash 是跟chunk相关的hash，同个chunk的文件hash相同</li><li>contenthash 是根据文件内容计算hash，文件内容不变，hash不变。有利于CDN缓存 👍</li></ul><h2 id="reference" tabindex="-1">Reference <a class="header-anchor" href="#reference" aria-label="Permalink to &quot;Reference&quot;">​</a></h2><ul><li><a href="https://www.cnblogs.com/skychx/p/webpack-hash-chunkhash-contenthash.html" target="_blank" rel="nofollow noopener noreferrer">https://www.cnblogs.com/skychx/p/webpack-hash-chunkhash-contenthash.html</a></li></ul>',5),o=[s];function c(l,r,u,i,d,f){return e(),a("div",null,o)}const _=h(n,[["render",c]]);export{p as __pageData,_ as default};
